import React, { Component } from 'react';
import bannerImg1 from "../img/banner-1.jpg";
import bannerImg2 from "../img/banner-2.png";
import bannerImg3 from "../img/banner-3.jpg";
import bannerImg4 from "../img/banner-4.jpg";


import styled from "styled-components";



export default class Slider extends Component {


    render() {

        return (
            <div className="container-fluid px-0">

                <div className="carousel slide" data-ride="carousel">
                    <div className="carousel-inner">
                        <div className="carousel-item active">
                            <img className="img-fluid w-100" src={bannerImg1}></img>
                        </div>
                        <div className="carousel-item active">
                            <img className="img-fluid w-100" src={bannerImg2}></img>
                        </div>
                        <div className="carousel-item active">
                            <img className="img-fluid w-100" src={bannerImg3}></img>
                        </div>
                    </div>
                </div>
            </div>



        )
    }
}

